"use strict";
({ params, imports }) => {
  const encounter = params.entity;
  const moment = imports.moment;
  const scheduleBuilder = new imports.rulesConfig.VisitScheduleBuilder({encounter});

  if( moment(encounter.earliestVisitDateTime).format('dddd') === 'Saturday' ){
    const earliestDate = moment(encounter.earliestVisitDateTime).day(6).add(7,'days').toDate();
    const maxDate = moment(earliestDate).add(1, 'days').toDate();
    scheduleBuilder.add({name: "Senior Health Worker Weekly Reporting", encounterType: "Senior Health Worker Weekly Reporting", earliestDate, maxDate});  
} else {
    const earliestDate = moment(encounter.earliestVisitDateTime).day(6).toDate();
    const maxDate = moment(earliestDate).add(1, 'days').toDate();
    scheduleBuilder.add({name: "Senior Health Worker Weekly Reporting", encounterType: "Senior Health Worker Weekly Reporting", earliestDate, maxDate});
}

  return scheduleBuilder.getAll();
};
